import React, { useEffect, useState } from 'react';
import { getFieldSuggestions } from '../utils/aiRules';
import { AIFieldSuggestion } from '../types';

const FieldSuggestions: React.FC = () => {
    const [suggestions, setSuggestions] = useState<AIFieldSuggestion[]>([]);

    useEffect(() => {
        const fetchSuggestions = async () => {
            // Provide an input string, e.g. "email" or any relevant text
            const fields = await getFieldSuggestions('email');
            setSuggestions(fields);
        };
        fetchSuggestions();
    }, []);

    return (
        <div>
            <h3>Field Suggestions</h3>
            <ul>
                {suggestions.map((s, idx) => (
                    <li key={idx}>{s.label} ({s.type})</li>
                ))}
            </ul>
        </div>
    );
};

export default FieldSuggestions;
